import H1Vertical from './H1vertical/h1vertical'
import NoteList from './NotesList/notelist'
import './NotePage.css'

const NotePage = () => {
  return (
    <>
      <H1Vertical side="left" text="Note Taker" />
      <NoteList />
      <H1Vertical side="right" text="Note Taker" />
    </>
  )
}

export default NotePage
